import numpy as np


class DFS(object):
    def __init__(self, data):
        self.n = int(np.sqrt(len(data)))
        self.graph = np.reshape(data, (self.n, self.n))
        self.visited = np.zeros(self.n, dtype=bool)

    def dfs(self, start_node):
        component = set()
        stack = [start_node]
        while stack:
            node = stack.pop()
            component.add(node + 1)
            self.visited[node] = True
            for neighbor_index in range(self.n):
                if (self.graph[node, neighbor_index] == 1) and not self.visited[neighbor_index]:
                    stack.append(neighbor_index)
        return component

    def find_components(self):
        components = []
        for node in range(self.n):
            if not self.visited[node]:
                component = self.dfs(node)
                components.append(component)
        return components


